import React from "react";
import { Route } from "react-router-dom";
import SignupForm from "./components/SignupForm";
import Home from "./components/Home";
import Login from "./components/Login";

const App = () => {
  return (
    <>
      <Navbar />
      <Route exact path="/">
        <Home />
      </Route>

      <Route path="/login">
        <Login />
      </Route>

      <Route path="/signup">
        <SignupForm />
      </Route>
    </>
  );
};

export default App;
